Jodie Marsh Body Builder
Highly anticipated special, 'Jodie Marsh: Bodybuilder' gives viewers a unique insight into the extraordinary world of female bodybuilding through the eyes of glamour model Jodie Marsh, as she goes from Men's Magazine pin-up to ripped bodybuilding champion.
This intimate documentary follows the former party girl as she cuts out the clubs and alcohol and embarks on a gruelling two month personal journey to pump iron and participate in a national natural bodybuilding competition. Jodie's gruelling gym regime will involve training for eight hours a day, seven days a week, eating half her recommended daily allowance of calories, ripping every muscle in her body and taking herself to the absolute limits.
In addition to her tough natural training, the star bodybuilder must clear her house of all fattening foods, learn how to pose bodybuilding style, eat 17 carbohydrate heavy meals in the space of 12 hours, reduce her body fat to just 10 per cent, eat fish for the first time ever in her life (she's a strict vegetarian) and take a polygraph test to prove she has not used performance enhancing drugs. 
It will take blood, sweat and tears to achieve this ultimate goal. Will it all be worth it?

